    @Test
    public void tesTruncate() {
        String sql1 = "TRUNCATE TABLE t_test";
        String sql2 = "select count(1) from t_test";
        try(Connection connection = DBUtil.getConnection();
            Statement st = connection.createStatement()){

            ResultSet rs = st.executeQuery(sql2);
            rs.next();
            System.out.println("删除之前，共有记录[" + rs.getInt(1) + "]");

            st.execute(sql1);
            System.out.println("删除完成");

            rs = st.executeQuery(sql2);
            rs.next();
            System.out.println("删除之后，共有记录[" + rs.getInt(1) + "]");
        } catch (SQLException e) {
            e.printStackTrace();
        }
    }

    @Test
    public void testDropTable() {
        String sql1 = "DROP TABLE t_test_temp";
        String sql2 = "CREATE TABLE t_test_temp as select * from t_test where field1='2229'";
        try(Connection connection = DBUtil.getConnection();
            Statement st = connection.createStatement()){
            st.execute(sql1);
            System.out.println("删除完成");
            st.executeQuery(sql2);
            System.out.println("建表完成");
        } catch (SQLException e) {
            e.printStackTrace();
        }
    }

